import React from "react";

const BlocAnimate = () => {
  return (
    <div
      className="animateMyBg"
      style={{
        backgroundImage: "url('./img/imgYellow.png')",
        backgroundSize: "cover",
        height: "574px"
      }}
    >
      <div>
        <ul>
          <li>
            <img src="./img/heart.png" alt="heart" />
          </li>
        </ul>
      </div>
    </div>
  );
};

export default BlocAnimate;
